import React from 'react';
import './App.css'; // CSS 파일 추가
import profile1 from './images/an.png';
import profile2 from '.assets/um.png';

const ProfileCard = ({ name, image, details }) => {
  return (
    <div className="profile-card">
      <img src={image} alt={`${name} 사진`} className="profile-image" />
      <h2 className="profile-name">{name}</h2>
      <ul className="profile-details">
        {details.map((detail, index) => (
          <li key={index}>{detail}</li>
        ))}
      </ul>
    </div>
  );
};

const App = () => {
  const profiles = [
    {
      name: '안희주 센터장',
      image: 'url-to-image1.jpg', // 첫 번째 인물 사진 URL
      details: [
        '한양대학교 융합대학원 미술교육 전공 박사수료',
        '한양대학교 심리상담학 석사',
        '임상심리사 2급(한국임상심리학회)',
        '청소년상담사 2급(여성가족부)',
        // 나머지 내용...
      ],
    },
    {
      name: '엄혜주 원장',
      image: 'url-to-image2.jpg', // 두 번째 인물 사진 URL
      details: [
        '용인대학교 예술치료학 예술치료 전공 박사과정',
        '전북대학교 미술치료학 석사',
        '임상심리사 2급(한국임상심리학회)',
        '청소년상담사 3급(여성가족부)',
        // 나머지 내용...
      ],
    },
  ];

  return (
    <div className="profiles-container">
      {profiles.map((profile, index) => (
        <ProfileCard
          key={index}
          name={profile.name}
          image={profile.image}
          details={profile.details}
        />
      ))}
    </div>
  );
};

export default App;
